import React from 'react';
class Home extends React.Component {
    render() {
        var layoutContent = {
            width: '100%'
        }
        return (
            <div class="columns">
                <div class="column" />
                <div class="column is-two-thirdss">
                    <figure style={layoutContent} class="image is-128x128">
                        <img src="https://bulma.io/images/placeholders/128x128.png" />
                    </figure>
                </div>
                <div class="column" />
            </div>
        );
    }
}
export default Home
